const genres = ["Albania","Anguilla","Argentina","Australia","Austria","Bahamas","Belgium","Brazil","Caribbean Netherlands","Chile","China","Costa Rica","Croatia","Curacao","Cyprus","Czech Republic","Dominican Republic","Ecuador","El Salvador","France","Germany","Greece","Grenada","Honduras","Hungary","Iceland","Ireland","Israel","Italy","Jordan","Kenya","Madagascar","Maldives","Malta","Mexico","Morocco","Netherlands","Nicaragua","Norway","Panama","Peru","Philippines","Poland","Portugal","Republic of San Marino","Serbia","Seychelles","Slovenia","South Africa","Spain","Switzerland","Thailand","Turkey","United Arab Emirates","United Kingdom","United States","Venezuela"]

const slugFix = { 'spain': 'espana', 'republic-of-san-marino': 'repubblica-di-san-marino', 'belgium': 'belgique', 'brazil': 'brasil', 'croatia': 'hrvatska', 'germany': 'deutschland', 'greece': 'ellada', 'italy': 'italia', 'norway': 'norge', 'serbia': 'srbija', 'slovenia': 'slovenija', 'switzerland': 'schweiz' }

const prefix = 'skylinewebcams:'

const manifest = {
    id: 'org.skylinewebcams',
    version: package.version,
    logo: 'https://i.pinimg.com/280x280_RS/a8/5c/32/a85c32373fa8b45f23ac0bf24394a40e.jpg',
    name: 'Skyline Webcams',
    description: 'Watch more then 640 webcams from 57 countries around the globe',
    resources: ['catalog', 'meta', 'stream'],
    types: ['tv', 'movie'],
    idPrefixes: [prefix],
    catalogs: [
      {
        id: 'skyline-search',
        name: 'Skyline Webcams',
        type: 'tv',
        genres,
        extra: [
          { name: 'search' },
          { name: 'skip' },
          { name: 'genre' }
        ]
      }
    ]
}

const addon = new addonBuilder(manifest)

function toMeta(obj) {
	// a larger image exists at: https://static.skylinewebcams.com/395.jpg
	// but as we use a cors proxy, i'll leave the small one for the background too
	const poster = 'http://goxcors.appspot.com/cors?method=GET&url=' + obj.poster
	return {
		id: prefix + base64.btoa(obj.href) + ':' + obj.id,
		name: obj.name,
		description: obj.name + ' - ' + obj.description,
		type: 'movie',
		poster,
		posterShape: 'landscape',
		logo: poster,
		background: poster
	}
}

addon.defineCatalogHandler(args => {
	return new Promise((resolve, reject) => {
		if (args.extra.search) {
			const metas = []
			webcams.forEach(webcam => {
				if (webcam.name.toLowerCase().includes(args.extra.search.toLowerCase()))
					metas.push(toMeta(webcam))
			})
			if (metas.length)
				resolve({ metas, cacheMaxAge: config.cacheTime })
			else
				reject('No search results for: ' + args.extra.search)
		} else {
			const skip = parseInt(args.extra.skip || 0)
			if (!args.extra.genre) {
				resolve({ metas: webcams.slice(skip, skip + 50).map(toMeta) })
			} else {
				let filter = args.extra.genre.toLowerCase().split(' ').join('-')
				filter = slugFix[filter] || filter
				const metas = []
				webcams.forEach(webcam => {
					if (webcam.href.split('/')[3] == filter)
						metas.push(toMeta(webcam))
				})
				if (metas.length)
					resolve({ metas: metas.slice(skip, skip + 50), cacheMaxAge: config.cacheTime })
				else
					reject('No webcams for filter: ' + args.extra.genre)
			}
		}
	})
})

addon.defineMetaHandler(args => {
	return new Promise((resolve, reject) => {
		const id = args.id.replace(prefix, '').split(':')[1]
		let meta
		webcams.some(webcam => {
			if (id == webcam.id) {
				meta = toMeta(webcam)
				return true
			}
		})
		if (meta)
			resolve({ meta, cacheMaxAge: config.cacheTime })
		else
			reject('Could not find meta data for: ' + args.id)
	})
})

addon.defineStreamHandler(args => {
	return streams(prefix, args)
})

module.exports = addon.getInterface()
